// src/components/Skills.js
import React from 'react';
import '../css/Skills.css';

const skills = [
    'CSS', 'PHP', 'HTML', 'Linux', 'MySQL', 'Apache', 'cPanel', 'Plesk', 'Analytics', 
    'phpMyAdmin', 'Social Media', 'Web Analytics', 'E-commerce', 'Online Marketing', 
    'Online Advertising', 'Data Science', 'Data Analytics', 'WordPress', 
    'Social Networking', 'Social Media Marketing', 'Web Design', 
    'Linux Admin', '(SEO)', '(CSS)', '(AWS)', 'Ansible'
];

const Skills = () => {
    return (
        <div className="skills">
            <h1><u>Skills</u></h1>
            <div className="skills-grid">
                {skills.map((skill, index) => (
                    <div key={index} className="skill-bubble">
                        {skill}
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Skills;
